import React from 'react'
import Navigation from './Navigation'
import Head from "next/head";


const Layout = (props) => {
    return (
        <div>
            <Head>
           <title>Next project/services</title> 
           <meta name="description" content="esto es services"></meta>
        </Head>
            <Navigation/>
            <div>
                {props.children}
            </div>
        </div>
    )
}

export default Layout
